import Articletitle from 'components/common/Articletitle';
import React from 'react';
import styled from 'styled-components';
import {
	Article3Minutes,
	ArticleVODList,
	HomeTopbannerDummydata,
} from 'utils/mockData';
import TopBanner from '../../components/common/TopBanner';
import ArticleWrapper from './ArticleWrapper';
import ChipScroll from './ChipScroll';
import Divider from './Divider';

function HomePage() {
	return (
		<ComponentsWrapper>
			<TopBanner data={HomeTopbannerDummydata} />
			<section className="section">
				<div className="box-section-wrapper">
					<Articletitle title="나에게 필요한 커리어 인사이트" icon />
					<ChipScroll />
				</div>
			</section>

			<BnnaerCreatApplication>
				<div className="banner-container">
					<div className="banner-creatapplication-content">
						즐겨보는 <span>크리에이터의</span> 글도 추천하고 싶다면?
					</div>
					<div className="banner-creatapplication-imgwrapper">
						<img
							src="https://image.wanted.co.kr/optimize?src=https%3A%2F%2Fimage.wanted.co.kr%2Fuserweb%2Fcareerhome%2Fcreator-application.png&amp;w=121&amp;q=75"
							alt="크리에이터 추천하기"
							loading="lazy"
						/>
					</div>
					<a
						href="https://forms.gle/uurkbpmkA1FapxGJ6"
						target="_blank"
						rel="noreferrer"
					>
						<span>크리에이터 추천하기</span>
					</a>
				</div>
			</BnnaerCreatApplication>

			<section className="section">
				<div className="box-section-wrapper">
					<ArticleWrapper
						title="3분만에 읽는 Wanted+ 아티클"
						subtitle="아티클 전체보기"
						data={Article3Minutes}
					/>
				</div>
			</section>
			<Divider />

			<section className="section">
				<div className="box-section-wrapper">
					<ArticleWrapper
						title="직장인을 위한 Wanted+ VOD"
						subtitle="VOD 전체보기"
						data={ArticleVODList}
					/>
				</div>
				<Divider />
			</section>

			<div className="linebanner banner-container">
				<div className="linebanner-gradient">
					<span>
						직군/직무를 입력하면 관련 콘텐츠를 추천해 드려요.
						<em>👀</em>
					</span>
				</div>
			</div>
		</ComponentsWrapper>
	);
}

const BnnaerCreatApplication = styled.div`
	display: flex;
	height: 110px;
	background-color: #36f;
	a {
		width: 220px;
		height: 40px;
		font-size: 15px;
		color: #36f;
		background-color: #fff;
		border: 1px solid #36f;
		position: relative;
		display: -ms-inline-flexbox;
		display: inline-flex;
		-ms-flex-align: center;
		align-items: center;
		-ms-flex-pack: center;
		justify-content: center;
		vertical-align: middle;
		min-width: 64px;
		padding: 0 27px;
		-webkit-box-sizing: border-box;
		box-sizing: border-box;
		border-radius: 25px;
		font-size: 16px;
		font-weight: 700;
		line-height: normal;
		cursor: pointer;
	}

	.banner-creatapplication-content {
		font-size: 24px;
		color: #fff;
		font-weight: 500;
		line-height: 35px;
		letter-spacing: -0.2px;
		align-self: auto;
		flex-wrap: nowrap;
		align-items: flex-start;
		justify-content: flex-start;
		flex-direction: row;
		box-sizing: border-box;
		> span {
			color: #a9ecf0;
		}
	}
	.banner-creatapplication-imgwrapper {
		flex-grow: 1;
		align-self: auto;
		flex-wrap: nowrap;
		align-items: flex-start;
		justify-content: flex-start;
		flex-direction: row;
		box-sizing: border-box;
		margin: 0;
	}
`;

const ComponentsWrapper = styled.div`
	padding-top: 25px;

	.section {
		position: relative;
		scroll-margin-top: 4px;
		padding: 60px 0;
	}
	.box-section-wrapper {
		max-width: 1060px;
		width: 87.72%;
		/* width: 1060px; */
		margin: 0 auto;
	}
	.banner-container {
		max-width: 1060px;
		width: 87.72%;
		margin: 0 auto;
		display: flex;
		flex-direction: row;
		align-self: auto;
		flex-wrap: nowrap;
		align-items: center;
		justify-content: flex-start;
	}
	.linebanner {
		margin-top: 0 !important;
		margin: 60px auto 0;
	}
	.linebanner-gradient {
		background-image: linear-gradient(
			90deg,
			#01a9fe -12%,
			#2f5fef 37%,
			#046afe 72%,
			#00d2dd 110%
		);
		padding: 21px 30px;
		font-size: 17px;
		border-radius: 38.5px;
		line-height: normal;
		display: flex;
		flex-grow: 1;
		justify-content: center;
		align-items: center;
		padding: 17px 30px;
		color: #fff;
		font-size: 15px;
		font-weight: 700;
		border-radius: 4px;
	}
`;

export default HomePage;
